]]> Den aktuelle udstilling har titlen “Modspil” og er et tilbageblik på de seneste 30 års samliv og samarbejde, hvor vi konstant har givet hinanden både kamp til stregen og sandheder at høre. Forhåbentlig hver gang med det bedst mulige resultat til følge – både privat og professionelt. Derfor er der på udstillingen helt nye værker såvel som enkelte, der på forskellig vis trækker tråde tilbage til 1990erne. Her er et lille preview af udstillingen, der ferniseres lørdag den 23. august kl. 11 og e
